import Navbar from '../navbar/Navbar';
import { CSSReset } from '@chakra-ui/core';

const Layout = (props) => {
  return (
    <>
      <CSSReset />
      <Navbar></Navbar>
      {props.children}
    </>
  );
};

export default Layout;
